Game Description
Join the Sorceress as she battles formidable opponents on her quest for eternal glory and immortality. Make your way to the Frozen Mountain in Quest of the Sorceress, a powerful match-3 adventure.

Fierce foes endowed with an amazing array of lethal skills and deadly weapons are waiting for you at each point on the path. Manage your power and wellbeing when you're in battle and strategically take down each adversary. Collect diamonds and healing potions to bolster your power and maintain your strength.
